Даже самый тщательный домашний уход не обеспечивает полноценное очищение кожи от загрязнений. Основная сложность заключается в избавлении от остатков кожного сала, забивающих поры, и нормализации работы сальных желез.  Чистые поры, освобождённые от сальных и грязевых отложений, гораздо лучше воспринимают уходовые и лечебные процедуры, поэтому первым шагом в любом косметологическом лечении всегда становится тщательное очищение лица. С профилактической целью их необходимо выполнять не реже чем каждые 3-4 месяца, а при проблемной коже – ежемесячно и даже чаще. Периодичность проведения чисток определяется индивидуально, в некоторых случаях ее необходимо очищать не реже 2-3 раз в месяц.

Кому показана чистка лица?

угревая сыпь. 
жирный блеск и расширенные поры.
комедоны (чёрные точки), 
милиумы (белые сухие прыщики)
 и другие мелкие дефекты.
пониженный тонус.

Как правило, после процедуры внешний вид кожных покровов лица улучшается: она становится гладкой, более упругой, появляется естественный румянец и здоровый, свежий вид.

Запись в директ. 

